function SearchBar({ onSearch }) {
  const [patientId, setPatientId] = useState("");
  const [type, setType] = useState("");

  function submitPatientId(e) {
    e.preventDefault();
    onSearch(patientId);
    setPatientId("");
  }

  return (
    <div>
      <form className="add-form" onSubmit={submitPatientId & setType}>
        <input
          type="text"
          placeholder="Patient"
          value={patientId}
          onChange={e => setPatientId(e.target.value)}
        />
        <input
          type="text"
          placeholder="Filetype"
          value={patientId}
          onChange={e => setPatientId(e.target.value)}
        />
        <input type="submit" value="Search" className="btn btn-block" />
